import React from 'react';
import {BrowserRouter as Router,Route}from "react-router-dom"
import LoginSignUp from './Pages/login-SignUp.component'
function App() {
  return (
    <Router>
      <Navbar/>
      <br/>
      <Route path="/"exact component={LoginSignUp}/>
    </Router>
  );
}

export default App;
